import React from 'react';
import Details from './component/Details';
import Main from './Main';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/"><button>Homebutton</button></Link>
              </li>
            </ul>
          </nav>
          <Switch>
            <Route path="/Details/:name">
              <Details />
            </Route>
            <Route exact path="/">
              <Main />
            </Route>
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
